  }, "\uADF8\uB0E5 \uBC1B\uC544\uB4E4\uC774\uACE0 \uACAC\uB514\uBA70 \uB300\uC751\uD558\uB294 \uACBD\uC6B0"), " - \uAD00\uACC4\uC758 \uD55C \uAD6D\uBA74\uC774 \uBC14\uB014 \uB54C \uBD88\uD655\uC2E4\uC131\uC744 \uB9CE\uC774 \uB290\uAF08\uB358 \uAC83 \uAC19\uB2E4. \uC21C\uAC04\uB9C8\uB2E4 \uC0DD\uC18C\uD55C \uC138\uC0C1\uC73C\uB85C \uB4E4\uC5B4\uAC00\uB294 \uB4EF \uD588\uB2E4. \uAC00\uAE4C\uC6B4 \uC0AC\uC774\uB97C \uACC4\uC18D\uD560 \uC218 \uC5C6\uC744 \uB54C \uB098\uB294 \uC774\uC81C \uC5B4\uB5BB\uAC8C \uB418\uB294 \uAC83\uC778\uC9C0\uB97C \uC0DD\uAC01\uD588\uB2E4.\n\uC774\uB7F0 \uB958\uC758 \uBD88\uD655\uC2E4\uC131\uB4E4\uC740 \uADF8 \uBCF8\uC9C8\uC744 \uB530\uC838\uBCF4\uAE30\uC5D4 \uB0B4\uAC00 \uB108\uBB34 \uC9C0\uCCD0\uC788\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uC544\uC11C, \uB2E4\uAC00\uC62C \uB9C8\uC74C\uC758 \uC5B4\uB824\uC6C0 \uAC19\uC740 \uAC83\uB4E4\uC744 \uC138\uC5B4 \uBCF4\uB824\uB2E4\uAC00 \uD3EC\uAE30\uD558\uACE0 \uADF8\uB0E5 \uC27D\uAC8C \uAD34\uB86D\uAE30\uB97C \uD0DD\uD588\uB2E4. \uC0AC\uC2E4 \uB2EC\uB9AC \uC218\uAC00 \uC5C6\uB2E4. \uAD34\uB86D\uB2E4\uAC00 \uAD34\uB86D\uB2E4\uAC00 \uC5B4\uB290\uC815\uB3C4 \uC2DC\uAC04\uC774 \uC9C0\uB098\uBA74 \uC774\uC804 \uAD00\uACC4 \uC548\uC5D0\uC11C\uB294 \uD558\uC9C0 \uBABB\uD558\uB294 \uAC83\uB4E4\uC744 \uD574\uBCF4\uB294 \uB0B4 \uBAA8\uC2B5\uC744 \uBCF4\uACE0\uB294 \uB9C8\uC74C\uC774 \uC0B0\uB73B\uD574\uC9C4\uB2E4."), mdx("p", null, mdx("strong", {
    parentName: "p"
  }, "\uBD88\uD655\uC2E4\uC131\uC744 \uBD84\uD574\uD574 \uC791\uC740 \uC870\uAC01\uB4E4\uB85C \uB9CC\uB4E4\uC5B4 \uC704\uD5D8\uC744 \uD68C\uD53C\uD558\uB294 \uACBD\uC6B0"), " - \uC6B0\uB9AC\uAC00 \uB9CC\uB4DC\uB294 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uC758 \uC694\uAD6C\uC0AC\uD56D\uC740 \uC544\uBB34\uB3C4 \uADF8 \uC804\uCCB4\uB97C \uD5E4\uC544\uB9B4 \uC218 \uC5C6\uB2E4. \uBCF5\uC7A1\uD55C \uB3D9\uC791\uC744 \uACC4\uC18D \uAD6C\uD604\uD558\uB294 \uAC83 \uB9CC\uC73C\uB85C\uB294 \uC5B4\uB5BB\uAC8C \uD574\uBCFC \uC218 \uC5C6\uB294 \uBD88\uD655\uC2E4\uC131\uACFC \uC2F8\uC6B0\uBA74\uC11C \uAE30\uACC4\uB294 \uC55E\uC73C\uB85C \uAC04\uB2E4.\n\uC81C\uD488 \uAD00\uB828\uD55C \uACB0\uC815\uC744 \uB0B4\uB9B4 \uB54C \uBBF8\uB8F0 \uC218 \uC5C6\uB2E4\uBA74 \uACB0\uAD6D \uB2F5\uC774 \uC874\uC7AC\uD574\uC57C \uD55C\uB2E4. \uC774\uB54C \uBB38\uC81C\uB97C \uC791\uAC8C \uCABC\uAC1C \uAC01 \uACB0\uC815\uC774 \uC81C\uD488\uC5D0 \uBBF8\uCE58\uB294 \uC601\uD5A5\uC744 \uC791\uAC8C \uB9CC\uB4E4\uACE0, \uAC1C\uC911 \uAC00\uC7A5 \uB098\uC740 \uAC83\uC744 \uAC00\uB2A5\uD55C \uBE68\uB9AC \uC120\uD0DD\uD55C\uB2E4. \uC5B4\uB5A4 \uC120\uD0DD\uC740 \uC2E4\uD328\uD55C\uB2E4. \uC870\uAC01\uB0B8 \uACB0\uC815\uC740 \uC601\uD5A5 \uBC94\uC704\uAC00 \uD06C\uC9C0 \uC54A\uB2E4. \uC27D\uACE0 \uBE60\uB974\uAC8C \uCE58\uC6CC\uBC84\uB9AC\uACE0 \uB2E4\uB978 \uC120\uD0DD\uC744 \uB0B4\uB9B0\uB2E4. \uAC1C\uBBF8 \uAD70\uB2E8\uC774 \uB545\uC5D0 \uB5A8\uC5B4\uC9C4 \uC0AC\uD0D5\uC744 \uBD84\uD574\uD574 \uC9D1\uC73C\uB85C \uAC00\uC838\uAC00\uB4EF \uBD88\uD655\uC2E4\uD568\uC744 \uBE60\uB974\uAC8C \uC870\uAE08\uC529 \uBD84\uD574\uD574\uB0B8\uB2E4."), mdx("p", null, mdx("strong", {
    parentName: "p"
  }, "\uBD88\uD655\uC2E4\uD568\uC744 \uC77C\uC815 \uC218\uC900 \uB300\uBE44\uD558\uB294 \uC758\uC0AC\uACB0\uC815\uC744 \uD558\uB294 \uACBD\uC6B0"), " - \uC8FC\uC2DD \uD22C\uC790\uC5D0\uC11C\uC758 \uBD88\uD655\uC2E4\uC131\uC740 \uB9AC\uC2A4\uD06C, \uC190\uC2E4\uC744 \uBCFC \uC218 \uC788\uB2E4\uB294 \uC810\uC774\uACA0\uB2E4. \uAE30\uC220 \uBD84\uC11D\uC774\uB098 \uD380\uB354\uBA58\uD0C8\uACFC \uC0C1\uAD00\uC5C6\uC774 \uACB0\uAD6D \uC8FC\uAC00\uB294 \uC5B4\uB5BB\uAC8C \uAC08\uC9C0 \uBAA8\uB978\uB2E4.\n\uBE44\uAD50\uC801 \uCAC4\uBCF4\uC778 \uB098\uB294 \uB9E4\uB9E4 \uACB0\uC815\uC744 \uD560 \uB54C\uB9C8\uB2E4 \uD2B9\uC815 \uBD88\uD655\uC2E4\uC131\uC744 \uACC4\uC18D \uC0DD\uAC01\uD558\uB294 \uD3B8\uC774 \uB098\uC558\uB2E4. \uAC00\uB2A5\uC131\uC774 \uB192\uC740 \uD61C\uC790 \uC2DC\uB098\uB9AC\uC624\uAC00 \uC788\uC5B4\uB3C4 \uADF8 \uAE30\uD68C\uC5D0 \uBAA8\uB4E0 \uAC83\uC744 \uAC78\uC9C0 \uC54A\uB294 \uC2DD\uC774\uB2E4. \uBAA8\uB4E0 \uAC83\uC774 \uBC15\uC0B4\uB0AC\uC744 \uB54C \uB300\uC751\uD558\uB294 \uAC74 \uB108\uBB34 \uB2A6\uC744 \uD14C\uB2C8 \uB300\uBE44\uD558\uB294 \uAC83\uC774\uB2E4. \uC758\uC0AC\uACB0\uC815\uC744 \uB108\uBB34 \uB9CE\uC774 \uD558\uB294 \uAC83\uB3C4 \uBB38\uC81C\uAC00 \uB420 \uC218 \uC788\uB2E4. \uB9CE\uC744\uC218\uB85D \uB354 \uB9CE\uC740 \uC790\uC0B0\uC744 \uD655\uB960\uC5D0 \uB9E1\uAE30\uAC8C \uB418\uB294 \uC148\uC774\uB2C8."), mdx("p", null, "\uB0B4 \uAC1C\uC778\uC801 \uC0B6\uC5D0 \uBD88\uD655\uC2E4\uC131\uC774 \uBBF8\uCE58\uB294 \uC601\uD5A5\uC774 \uD074\uC218\uB85D \uC801\uADF9\uC801\uC73C\uB85C \uB300\uC751\uD558\uB824\uB294 \uD3B8\uC778 \uAC83 \uAC19\uB2E4. \uBB50 \uD68C\uC0AC \uC77C \uAC19\uC740 \uACBD\uC6B0\uB294 \uB2F9\uC5F0\uD788 \uD574\uC57C \uD558\uB294 \uAC70\uB77C\uC11C \uADF8\uB7F0 \uAC70\uAE30\uB3C4 \uD558\uC9C0\uB9CC, \uC804\uBC18\uC801\uC73C\uB85C \uB0B4 \uC6B0\uC6B8\uAC10\uC774\uB098 \uAE30\uBD84\uBCF4\uB2E4\uB294 \uD68C\uC0AC\uC5D0\uC11C \uB9CC\uB4DC\uB294 \uC81C\uD488\uC774\uB098 \uC790\uC0B0\uC774 \uB354 \uC911\uC694\uD558\uB2E4."), mdx("p", null, "\uBBF8\uB798\uAC00 \uC5B4\uB5BB\uAC8C \uB420\uC9C0 \uBAA8\uB97C\uC218\uB85D \uBD88\uD655\uC2E4\uC131\uC744 \uC904\uC77C \uC218 \uC788\uB294 \uC801\uADF9\uC801\uC778 \uACB0\uC815\uC744 \uB0B4\uB9AC\uAE30 \uD798\uB4E4\uB2E4. \uD68C\uC0AC\uC5D0\uC11C \uB9CC\uB4DC\uB294 \uC81C\uD488\uC740 \uBC29\uD5A5\uC131, \uD639\uC740 \uC88B\uC740 \uC5D4\uC9C0\uB2C8\uC5B4\uB9C1 \uD504\uB799\uD2F0\uC2A4\uB97C \uCC3E\uC744 \uC218 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uBD88\uD655\uC2E4\uC131\uC744 \uB2E4\uB8F0 \uC218 \uC788\uC5C8\uC9C0\uB9CC, \uC8FC\uC2DD \uD22C\uC790\uC758 \uACBD\uC6B0\uB294 \uADF8\uB7F4 \uC218 \uC788\uB294 \uC5EC\uC9C0\uAC00 \uC801\uB2E4.\n\uBD84\uD560 \uB9E4\uB9E4 \uC815\uB3C4\uAC00 \uACA8\uC6B0 \uD560 \uC218 \uC788\uB294 \uC815\uB3C4. \uC880 \uB354 \uACF5\uBD80\uD558\uBA74 \uB098\uC544\uC9C0\uB824\uB098 \uC2F6\uAE30\uB3C4 \uD55C\uB370 \uC798 \uBAA8\uB974\uACA0\uB2E4."), mdx("p", null, "\uBD88\uD655\uC2E4\uC131\uC744 \uC904\uC77C \uC218 \uC788\uB294 \uC801\uADF9\uC801\uC778 \uACB0\uC815\uC744 \uB0B4\uB9B4 \uC218 \uC788\uB2E4\uB294 \uC0AC\uC2E4\uC774 \uC548\uC815\uAC10\uC744 \uD06C\uAC8C \uC900\uB2E4. \uC0B6\uC758 \uC601\uC5ED\uC5D0\uC11C\uB3C4 \uC704\uD5D8\uC744 \uC798\uAC8C \uBD84\uC0B0\uD558\uB294 \uC801\uADF9\uC801\uC778 \uD5E4\uC9D5\uC774 \uD544\uC694\uD558\uB2E4."), mdx("p", null, "\uC131\uACA9\uB9CC \uBCF4\uBA74 \uBD88\uD655\uC2E4\uD55C \uAC83\uC744 \uB9E4\uC6B0 \uC2EB\uC5B4\uD55C\uB2E4. \uC2EB\uC5B4\uB9CC \uD558\uB2E4 \uADF8\uB0E5 \uB208\uC55E\uC5D0\uC11C \uBD88\uD655\uC2E4\uD55C \uC0C1\uD669\uC744 \uCE58\uC6CC\uBC84\uB9AC\uACE0 \uC798 \uB2E4\uB8E8\uC9C0 \uBABB\uD55C \uC801\uB3C4 \uB9CE\uC544\uC11C, \uC694\uC998\uC5D4 \uB208 \uC9C8\uB048 \uAC10\uACE0 \uACAC\uB514\uBA70 \uD310\uB2E8 \uC798 \uD574\uBCF4\uB824\uACE0 \uD558\uB294 \uD3B8\uC774\uB2E4."));
